import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import VideoWatch from './components/VideoWatch';

// ... inside your Routes
<Route
  path="/video/:id"
  element={
    <ProtectedRoute>
      <>
        <Navbar />
        <VideoWatchWrapper />
      </>
    </ProtectedRoute>
  }
/>

// Wrapper to extract id param and pass to VideoWatch
import { useParams } from 'react-router-dom';
function VideoWatchWrapper() {
  const { id } = useParams();
  return <VideoWatch videoId={id} />;
}
